import React from 'react';
import { Button, Fab, ButtonGroup } from '@material-ui/core';

function MainControls() {
    return (
        <ButtonGroup variant="text">
            <Fab color="primary"> -1 </Fab>
            <Fab color="primary">Play</Fab>
            <Fab color="primary"> +1 </Fab>
        </ButtonGroup>
    );
}

export default MainControls;
